(10, 22, 'tl_article', 128, 1460811231, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:9:"Impressum";}', '<p><strong>SSV Bruneck Amateursportverein Sektion Volleyball</strong><br>Ferraristr. 26<br>I-39031 Bruneck (BZ)</p>\n<p>MwSt.Nr./Steuernr. 92015230219</p>\n<p>Sämtliche Bilder und Texte[nbsp]dieser Website sind urheberrechtlich geschützt. Jegliche Verwendung ohne schriftliche Genehmigung ist untersagt. Wir weisen ausdrücklich darauf hin, dass wir keinerlei Einfluss auf die Gestaltung und die Inhalte von Seiten haben, die von dieser Website aus verlinkt sind. Somit übernehmen wir keinerlei Haftung[nbsp]oder Garantie für den Inhalt dieser Seiten. Wir distanzieren uns klar von der auf diesen Seiten zum Ausdruck gebrachten Meinung, da diese nicht immer unserer Meinung entsprechen kann.</p>\n<p>Copyright: © SSV Bruneck Amateuersportverein</p>\n<p>[nbsp]</p>\n<p>[nbsp]</p>\n<h2>Nutzung von Cookies</h2>\n<p>Diese Website verwendet Cookies und verwandte Technologien um das korrekte Funktionieren zu ermöglichen und die Nutzung der angebotenen Dienste zu erleichtern.</p>\n<p><strong>Was sind Cookies?</strong><br>Ein Cookie ist ein kurzes Text-Snippet, das von einer von Ihnen besuchten Website an Ihren Browser gesendet wird. Es speichert Informationen zu Ihrem letzten Besuch, wie Ihre bevorzugte Sprache oder andere Einstellungen. So finden Sie sich auf der Website schneller zurecht und nutzen sie effektiver, wenn Sie sie das nächste Mal aufrufen. Cookies spielen eine wichtige Rolle. Ohne sie wäre das Surfen im Web oft frustrierend.</p>\n<p><strong>Warum nutzen wir Cookies?</strong><br>Wir nutzen diese Informationen, um unsere Website zu verbessern, damit unsere Besucher das bestmögliche Angebot erhalten. Unsere Plattform verwendet auch Cookies und ähnliche Technologien von sorgfältig ausgewählten Drittanbietern.</p>\n<p><strong>Arten von Cookies</strong><br>Diese Website verwendet folgende Cookies:</p>\n<ul>\n<li>technische Cookies und Cookies für analytische Zwecke: diese Cookies sammeln Informationen über die Nutzung der Website und helfen uns Auswertungen über die Auffindbarkeit der Informationen auf unserer Seite zu bekommen. Dies erfolgt zum Teil über einen Drittanbieter (Google). Diese Informationen sind nicht personenbezogen.</li>\n<li>Drittanbieter-Cookies: dies sind Cookies von anderen Anbietern. Beispiele dafür sind “social plugins” für Facebook, Twitter und Google+. Der Sinn davon ist z.B. das Teilen von Inhalten auf dne Social Network Plattformen zu ermöglichen oder zu erleichtern. Genaueres erfahren Sie auf den Informations-Seiten der Drittanbieter.</li>\n</ul>\n<p><strong>Cookies verwalten</strong><br>Sie können Cookies nach Belieben steuern und/oder löschen. Wie, erfahren Sie <a href="http://www.allaboutcookies.org/" target="_blank">hier</a>. Sie können alle auf Ihrem Rechner abgelegten Cookies löschen und die meisten Browser so einstellen, dass die Ablage von Cookies verhindert wird. Dann müssen Sie aber möglicherweise einige Einstellungen bei jedem Besuch einer Seite manuell vornehmen und die Beeinträchtigung mancher Funktionen in Kauf nehmen.</p>\n<p>[nbsp]</p>\n<p><strong>Programmierung</strong></p>\n<p>project|r des Roland Trebo<br>Dantestr. 12<br>39031 Bruneck<br><a title="Project|r, Internet [&] Marketing" href="http://www.projectr.it/" target="_blank">projectr.it</a>[nbsp]</p>\n<p>[nbsp]MwSt.Nr. 02618740217</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default'),
