(17, 12, 'tl_article', 64, 1460811183, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:14:"Reglement 2015";}', '<p><strong><u>Spielregeln:</u><br></strong>Beim Raiffeisen Beachcup wird nach den internationalen Beachvolleyball-Regeln der FIVB gespielt. Mehr Informationen dazu finden Sie auf der Homepage der FIVB oder hier[nbsp]<a href="http://www.beachcup.it/content/media/rules%20german.pdf">download</a></p>\n<p><u><strong>NEU 2015: Technische Richtlinien für die Austragung der Beachcup Jugend-Etappen</strong></u></p>\n<p>Das OK des Beachcup möchte in Zusammenarbeit mit der FIPAV Bozen, Abteilung Beachvolleyball, einige Grundsätze schaffen um der Jugendförderung im Beachvolleyball in Südtirol gerecht zu werden.</p>\n<p>Die Richtlinien findet ihr hier zum <a href="http://www.beachcup.it/images/reglement_jugend/reglement_jugend_2015_de.pdf">DOWNLOAD </a></p>\n<p><u><strong>Teilnahmeberechtigt:</strong></u></p>\n<p><strong>Am „Raiffeisen Beachcup“ können alle Sportler/Innen welche beim Fachsportverband FIPAV tesseriert sind und von ihrem Verein nicht für die Aktivität Beachvolleyball über das Online Portal der FIPAV gesperrt sind, teilnehmen. Jene die nicht über eine Tesserierung beim Fachsportverband FIPAV verfügen, können bei der Einschreibung (Anmeldeformular) eine sogenannte Tagestesserierung „tesseramento per evento“ beantragen, welche vorbehaltlich dessen Annahme zur Teilnahme an den Turnieren berechtigt.</strong>[nbsp]</p>\n<p><u>Kategorie Open M/F:</u></p>\n<p>Die Teilnahme am Turnier wird nur nach Vorlage eines[nbsp]<strong><u>gültigen sportärztlichen Attestes</u></strong>[nbsp](Sportarzt!) gewährt, welches die uneingeschränkte Eignung für die Ausübung dieser Sportart bescheinigt![nbsp]</p>\n<p><u>Kategorie Freizeit Herren:<br></u>Es sind alle Sportler teilnahmeberechtigt, welche[nbsp]ein gültiges ärztliches Zeugnis (Hausarzt oder Sportarzt) vorweisen können und[nbsp]in der abgelaufenen Hallen-Saison maximal in der italienischen Serie D und noch nie in der italienischen Serie B2 oder höher[nbsp]gespielt haben. Die selbe Einschränkung wird auf andere Ligen im Ausland angewendet. Zudem sind die Halbfinalisten der Raiffeisen Beachcup Open Etappen der letzten beiden Jahre hier[nbsp]<u>nicht</u>[nbsp]spielberechtigt.</p>\n<p>Für Frauen- oder Mixed-Teams gibt es keine getrennte Wertung und keine Begrenzung bezüglich ihres Spielniveaus.[nbsp]</p>\n<p>Das OK des Beachcups behält sich das Recht vor einzelne Spieler oder Mannschaften aufgrund ihrer Spielstärke die Teilnahme in dieser Kategorie zu erlauben oder zu verwehren.</p>\n<p><u>Kategorie Freizeit Damen:<br></u>Es sind alle Sportlerinnen teilnahmeberechtigt, welche[nbsp]ein gültiges ärztliches Zeugnis (Hausarzt oder Sportarzt) vorweisen können und[nbsp]in der abgelaufenen Hallen-Saison maximal[nbsp]in der italienischen 1. Division und noch nie in der italienischen Serie C oder höher[nbsp]gespielt haben.[nbsp]Die selbe Einschränkung wird auf andere Ligen im Ausland angewendet. Zudem sind die Halbfinalisten der Raiffeisen Beachcup Open Etappen der letzten beiden Jahre hier[nbsp]<u>nicht</u>[nbsp]spielberechtigt.</p>\n<p>Das OK des Beachcups behält sich das Recht vor, einzelne Spieler oder Mannschaften aufgrund ihrer Spielstärke die Teilnahme in dieser Kategorie zu erlauben oder zu verwehren.</p>\n<p><u>Kategorie Jugend:<br></u></p>\n<p>Es sind alle SportlerInnen teilnahmeberechtigt, welche[nbsp]ein gültiges ärztliches Zeugnis (Hausarzt oder Sportarzt) vorweisen können. Es gelten folgende Altersbeschränkungen:</p>\n<p>U18 M/F: [nbsp]geboren nach dem 01.01.1998</p>\n<p>U16 M/F: [nbsp]geboren nach dem 01.01.2000</p>\n<p>U14 M/F: [nbsp]geboren nach dem 01.01.2002</p>\n<p><strong><u>Einschreibungen:</u></strong></p>\n<p>Die Anmeldungen können ausschließlich online auf[nbsp]<strong><a href="http://www.beachcup.it/undefined/">www.beachcup.it</a></strong>[nbsp]bis innerhalb Mittwoch 18:00 Uhr vor der jeweiligen Etappe gemacht werden, solange noch freie Plätze verfügbar sind. Die Einschreibung ist nur gültig, wenn[nbsp]die Eigenerklärung bzw.[nbsp]<a href="http://www.beachcup.it/download/2015/Eigenerklaerung.pdf">Datenschutzerklärung</a>[nbsp]sowie das ärztliche Attest (Details dazu unter der jeweiligen Kategorie)[nbsp]ebenfalls innerhalb Mittwoch 18:00 Uhr vor der jeweiligen Etappe entweder an die Faxnummer 0474 05 06 08 oder an[nbsp] <a href="mailto:info@beachcup.it">info@beachcup.it</a>[nbsp]gesendet wird. [nbsp]Weitere Infos unter Tel. +39 393 7064116 oder per mail: <a href="mailto:info@beachcup.it">info@beachcup.it</a></p>\n<p><strong><u>Turniermodus:</u></strong></p>\n<p>Die Veranstaltung gliedert sich in mehrere Etappen und unterschiedliche Kategorien (Details zu jeder Etappe unter <a href="http://www.beachcup.it/de/turniere2015">Turniere 2015</a>).[nbsp]Die Turniere finden bei jeder Witterung statt.</p>\n<p>Spielkategorien:</p>\n<p>- Open Damen [&][nbsp]Herren<br>- Freizeit Herren [&][nbsp]Damen<br>- Jugend U18 Mädchen [&][nbsp]Buben<br>- Jugend U16 Mädchen [&][nbsp]Buben<br>- Jugend U14 Mädchen [&][nbsp]Buben</p>\n<p>Es ist aus organisatorischer Sicht nicht möglich, an einem Tag an zwei Bewerben teilzunehmen. Bei den Gruppenspielen wird ein Satz mit mindestens 15 Punkten im Rally-Point System gespielt, wobei ein Mindestvorsprung von 2 Punkten notwendig ist. Die erst- und zweitplatzierte Mannschaft qualifizieren sich für die nächste Runde. Bei den darauf folgenden Spielen wird ein Satz bis 21 Punkten gespielt. Das Finale wird in 2 Gewinnsätzen entschieden (3. Satz bis 15 Punkte).</p>\n<p>Erscheint eine Mannschaft nicht innerhalb 5 Minuten zu einem Spiel (Zeitplan laut Spielplan), wird das Spiel als verloren gewertet und zwar mit 15:8 bzw. 21:11.</p>\n<p>Für die U14 Jugendbewerbe wird in einem Feld von 7 X 14 m gespielt, alle anderen Bewerbe spielen auf einem Spielfeld mit 8 x[nbsp]16 m. Die Netzhöhen gelten wie folgt:</p>\n<p>U14w [nbsp]- [nbsp]2,05mU14m [nbsp]- [nbsp]2,15m</p>\n<p>U16w [nbsp]- [nbsp]2,15m U16m [nbsp]- [nbsp]2,35m</p>\n<p>U18/Damen - [nbsp]2,24 m U18/Herren - [nbsp]2,43m</p>\n<p><strong><u>Gesamtwertung:</u><br></strong><strong>Open:[nbsp]</strong>Für die Gesamtwertung werden die Punkte der drei Etappen zusammengezählt. Sollten 2 oder mehrere Mannschaften in der Gesamtwertung dieselbe Punktezahl aufweisen, wird das Team besser gewertet, das mehr Teilnahmen am Raiffeisen Beachcup hatte. Bei neuerlichem Gleichstand entscheidet die beste Platzierung in der Turnierserie.</p>\n<p><strong>Freizeit Herren:</strong>[nbsp]Für die Gesamtwertung werden die Punkte der drei Freizeitturniere und der drei Open-Turniere zusammengezählt, wobei nur die besten vier Etappen gewertet werden.</p>\n<p><strong>Freizeit Damen:</strong>[nbsp]Für die Gesamtwertung werden die Punkte der zwei Freizeitturniere und der drei Open-Turniere zusammengezählt, wobei nur die besten vier Etappen gewertet werden.</p>\n<p>In den<strong> Jugend-Kategorien </strong>gibt[nbsp]es keine Gesamtwertung.</p>\n<p><strong>Punktevergabe:<br></strong>1. Platz - 100 Punkte<br>2. Platz - 90 Punkte<br>3. Platz - 80 Punkte<br>4. Platz - 70 Punkte<br>Verlierer Viertelfinale - 60 Punkte<br>Verlierer Achtelfinale - 50 Punkte<br>Gruppendrittletzter - 40 Punkte<br>Gruppenvorletzter - 30 Punkte<br>Gruppenletzter - 20 Punkte</p>\n<p>Die Punkte werden pro Mannschaft vergeben.<br><strong>Bei der letzten Etappe wird die doppelte Punktezahl vergeben.<br></strong><strong>(1. Platz - 200 Punkte.; 2. Platz - 180 Punkte; 3. Platz - 160 Punkte; usw.)</strong></p>\n<p><strong><u>Nenngebühr*:</u><br></strong>Die Nenngebühr beinhaltet den Eintritt in die jeweiligen Schwimmbäder (falls vorhanden), sowie einmal für die gesamte Tour ein Spielleibchen des "Raiffeisen Beachcup" pro Spieler. "<a href="http://www.bankthefuture.it/">Bank The Future</a>" Kunden erhalten eine Ermäßigung von 20%.</p>\n<p>Jedes weitere Spielleibchen wird vom Veranstalter gegen den Unkostenbeitrag von € 15,00 weitergegeben (Materialkosten und Aufdruck).</p>\n<table>\n<tbody>\n<tr>\n<td>\n<p><strong>Kategorie</strong></p>\n</td>\n<td>\n<p><strong>Nenngebühr Erstteilnahme</strong></p>\n</td>\n<td>\n<p><strong>jede weitere Etappe</strong></p>\n</td>\n<td>\n<p><strong>Bank The Future Kunden</strong></p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Open</p>\n</td>\n<td>\n<p>50 Euro</p>\n</td>\n<td>\n<p>40 Euro</p>\n</td>\n<td>\n<p>20% Ermäßigung</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Freizeit</p>\n</td>\n<td>\n<p>40 Euro</p>\n</td>\n<td>\n<p>30 Euro</p>\n</td>\n<td>\n<p>20% Ermäßigung</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Jugend</p>\n</td>\n<td>\n<p>30 Euro</p>\n</td>\n<td>\n<p>20 Euro</p>\n</td>\n<td>\n<p>20% Ermäßigung</p>\n</td>\n</tr>\n</tbody>\n</table>\n<p><u><strong>*WICHTIG:</strong></u>[nbsp]für Spieler welche noch nicht beim Fachsportverband „FIPAV“ gemeldet sind und über das Einschreibeformular (Datenschutzerklärung) eine Tagestesserierung „tesseramento per evento“ beantragen fallen zusätzlich 2,00 € pro Etappe an.</p>\n<p>Erscheint eine Mannschaft nicht zu einer Etappe ohne sich vorher rechtzeitig abzumelden, muss die Einschreibegebühr trotzdem entrichtet werden.</p>\n<p><strong><u>Spielbekleidung:</u><br></strong>Die Spieler müssen[nbsp]<u>immer</u>[nbsp]mit den offiziellen Turnierdressen spielen.</p>\n<p><strong><u>Spielball:</u><br></strong>Der offizielle Spielball des "Raiffeisen Beachcup" ist der Mikasa VLS300. Dieser wird [nbsp]für die Spiele[nbsp]vom OK[nbsp]zur Verfügung gestellt.</p>\n<p><strong><u>Preisgeld:</u><br></strong>Pro Turnier wird um folgendes Preisgeld gespielt:</p>\n<p><u>Kategorie Open Herren:<br></u>Erstplatzierte Mannschaft € 160,00, Zweitplatzierte Mannschaft € 120,00, Drittplatzierte Mannschaft € 80,00</p>\n<p><u>Kategorie Open Damen:<br></u>Erstplatzierte Mannschaft € 120,00, Zweitplatzierte Mannschaft € 80,00, Drittplatzierte Mannschaft € 40,00</p>\n<p><u>Kategorien Freizeit Herren [&] Damen:<br></u>Sachpreise für die ersten 4 Mannschaften.</p>\n<p><u>Kategorie Jugend:<br></u>Sachpreise.</p>\n<p>Für die Gesamtwertung werden dieselben Preisgelder ausbezahlt wie bei einer einzelnen Etappe.</p>\n<p><strong>Preisverteilung:<br></strong>Die Preisverteilung findet stets nach Beendigung des Turniers statt. Die ersten vier Mannschaften werden prämiert.</p>\n<p><strong>Rahmenprogramm:<br></strong>Bei den einzelnen Etappen werden verschiedene Rahmenprogramme geboten. Details dazu findet man unter dem Link des jeweiligen Veranstaltungsortes auf <a href="http://www.beachcup.it/de/turniere2015">Turniere 2015</a>.</p>\n<p><strong>Organisation:<br></strong>Der RAIFFEISEN BEACHCUP wird vom SSV Bruneck ASV - Sektion Volleyball koordiniert und von den jeweiligen lokalen Veranstaltern organisiert. Details dazu findet man unter dem Link des jeweiligen Veranstaltungsortes auf <a href="http://www.beachcup.it/de/turniere2015">Turniere 2015</a>.</p>\n<p>Das Organisationskomitee fungiert lediglich als Koordinator der Tour.[nbsp]Die einzelnen Turniere werden selbstständig von den lokalen Organisatoren durchgeführt.</p>\n<p>Die Teilnahme erfolgt auf eigenes Risiko. Der Korrdinator und die lokalen Veranstalter übernehmen keinerlei Haftung für Unfälle vor, während und nach den Turnieren, auch nicht Dritten gegenüber. Jeder einzelne Spieler trägt die volle persönliche Verantwortung für seinen Gesundheitszustand.</p>\n<p><strong>Änderungen:</strong></p>\n<p>Der Veranstalter behält sich die Möglichkeit vor, Programmänderungen durchzuführen. Die Internetseite www.beachcup.it ist die offizielle Informationsquelle der Veranstaltung. Aus diesem Grund sind alle offiziellen Mitteilungen auf dieser Seite zu finden.</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default'),
(18, 13, 'tl_article', 256, 1460811207, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:36:"Beachvolley Landesmeisterschaft 2015";}', '<p>Auch 2015 werden die Südtiroler Beachvolleyball-Landesmeister wieder im Rahmen des Raiffeisen Beachcups gekürt. Die Landesmeisterschaft wird vom Raiffeisen Beachcup Organisationskomittee in Zusammenarbeit dem dem italienischen Volleyballverband der Provinz Bozen in der schönen Beachanlage beim Freibad von Bruneck organisiert.[nbsp]</p>\n<p>Am 15.08.2015 werden die Landesmeister der Kategorien Damen, Herren und U16 ermittelt. Am Sonntag folgen dann die Spiele der Jugendkategorien U14 und U18 jeweils männlich und weiblich.[nbsp]Bei diesem Turnieren können nur Mannschaften bzw. Spieler der Provinz Bozen teilnehmen.[nbsp]</p>\n<p><img src="http://www.beachcup.it/images/stories/sponsoren/fipavbz.png" alt="" width="144" height="144"></p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default'),
