(34, 43, 'tl_article', 64, 1460803707, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:16:"Regolamento 2015";}', '<p><strong><u>Regole di gioco:</u><br></strong>Per il "Raiffeisen Beachcup" valgono le regole internazionali del beach volley. Ulteriori informazioni sulle regole le trovate sul sito ufficiale FIVB o scaricando questo[nbsp]<a href="http://www.beachcup.it/content/media/Regolamento%20beach.pdf">download</a></p>\n<p><u><strong>NUOVO 2015: Direttive tecniche riguardo lo svolgimento delle tappe giovanili del Beachcup</strong></u></p>\n<p>L’OK Team del Beachcup vorrebbe definire alcune regole di base in collaborazione con la FIPAV Bolzano<br>(settore beach volley), per garantire il continuo incremento del settore giovanile nel beach volley in Alto Adige.</p>\n<p><a href="http://www.beachcup.it/images/reglement_jugend/regolamento_giovanile_2015.pdf">Scarica il regolamento</a></p>\n<p><strong>Condizioni per la partecipazione:</strong></p>\n<p><strong>Al Raiffeisen Beachcup possono partecipare tutti gli atleti tesserati FIPAV e dei quali la società di appartenenza non ha dato il divieto per l''attività di beach volley tramite il portale FIPAV online. Tutti i non tesserati presso la Federazione Italiana Pallavolo FIPAV possono richiedere tramite il modulo di iscrizione (liberatoria) un "tesseramento per singola manifestazione amatoriale" quale salvo accettazione autorizza alla partecipazione al singolo torneo/tappa.<br></strong></p>\n<p><u>Categoria "OPEN" M/F:<br></u></p>\n<p>La partecipazione al torneo è consentita solo presentando un <strong>certificato medico valido</strong> (medico sportivo) che certifica l''idoneità illimitata per lo sport praticato.</p>\n<p><u>Categoria "AMATORIALE Uomini“:<br></u>Possono partecipare tutti gli atleti in possesso di un <strong>certificato medico valido[nbsp]</strong>(medico di fiducia o medico sportivo) che certifica l''idoneità illimitata per lo sport praticato e che nella stagione invernale hanno al massimo giocato nel campionato italiano di Serie D e che in carriera non hanno mai giocato nel campionato italiano di Serie B2 o superiore. Questo vale anche per tutti i campionati paragonabili di un''altro paese. Anche i giocatori semifinalisti della categoria Open delle utlime due edizioni del Raiffeisen Beachcup sono esclusi.[nbsp]<br>Il comitato organizzatore si riserva di escludere anche singoli giocatori o squadre ritenute di alto livello. Per le coppie mixed non c''è una classifica separata e nessuna limitazione riguardante il loro livello di gioco.</p>\n<p><u>Categoria "AMATORIALE Donne“:<br></u>Possono partecipare tutte le atlete in possesso di un[nbsp]<strong>certificato medico valido[nbsp]</strong>(medico di fiducia o medico sportivo) che certifica l''idoneità illimitata per lo sport praticato e che nella stagione invernale hanno al massimo giocato nel campionato italiano "1a Divisione" e che in carriera non hanno mai giocato nel campionato italiano di Serie C o superiore. Questo vale anche per tutti i campionati paragonabili di un''altro paese. Anche le giocatrici semifinaliste della categoria Open donne delle utlime due edizioni del Raiffeisen Beachcup sono escluse.[nbsp]Il comitato organizzatore si riserva di escludere anche singole giocatrici o squadre ritenute di alto livello.</p>\n<p><u>Categoria giovanile U18, U16 e U14:</u></p>\n<p>Tutti i giovani devono presentare un <strong>certificato medico valido</strong> (medico di fiducia o medico sportivo) che certifica l''idoneità illimitata per lo sport praticato. Si gioca nelle seguenti categorie:</p>\n<p>U18 maschile e femminile: nati dopo il 01.01.1998</p>\n<p>U16 maschile e femminile: nati dopo il 01.01.2000</p>\n<p>U14 maschile e femminile: nati dopo il 01.01.2002</p>\n<p><strong>Iscrizioni:</strong></p>\n<p>L''iscrizione può essere fatta soltanto online sul sito <a href="http://www.beachcup.it/undefined/"><strong>www.beachcup.it</strong></a> entro le ore 18:00 del mercoledì precedente ad ogni singola tappa e fino all'' esaurimento dei posti liberi. L''iscrizione è valida solo se entro le ore 18:00 del mercoledì precedente alla prima tappa di partecipazione del atleta la <a href="http://www.beachcup.it/download/2015/Liberatoria.pdf">liberatoria</a> e il certificato medico sono stati mandati al numero fax 0474 05 06 08 o a <a href="mailto:info@beachcup.it">info@beachcup.it</a>. [nbsp] Informazioni: Tel. +39 393 7064116 o via email: <a href="mailto:info@beachcup.it">info@beachcup.it</a></p>\n<p><strong>Modalità del torneo:</strong></p>\n<p>L''evento è composto da più tappe e diverse categorie. (Dettagli sulle singole tappe vedasi sotto <a href="http://www.beachcup.it/it/tornei2015">Tornei 2015</a>).[nbsp]</p>\n<p><br>Categorie:<br>- Open femminile e[nbsp]maschile<br>- Amatoriale maschile e femminile<br>- Under 18 femminile e[nbsp]maschile<br>- Under 16 femminile e[nbsp]maschile<br>- Under 14[nbsp]femminile e[nbsp]maschile</p>\n<p>Non è possibile iscriversi a piu di una categoria in una giornata.</p>\n<p>Nella fase di qualificazione (giochi di gruppo) si gioca un set fino ad un mimimo di 15 punti (Rally-Point System). Per la vittoria è necessario avere due punti di vantaggio. Le prime due squadre di ogni gruppo si qualificano per il turno successivo. Dagli ottavi si gioca un set fino a 21 punti. La finale verrà decisa in due set vincenti (3. Set fino a 15 punti).</p>\n<p>Se una squarda dopo l''annuncio della partita (previsto dal tabellone) non si presenta entro cinque minuti sul campo da gioco, la partita sarà persa col punteggio di 15:8 o 21:11.</p>\n<p>Il campo da gioco per la categoria U14[nbsp] sara ridotto su 7 x 14 m, tutte le altre categorie si giocano sul campo 8 x 16 m. Per l''altezza rete vale:</p>\n<p>Feminile: U14w[nbsp] -[nbsp][nbsp]2.05 m[nbsp] Maschile: U14m[nbsp] - 2,15 m</p>\n<p>U16w- [nbsp]2,15 mU16m- 2,35 m</p>\n<p>U18/Donne - 2,24 mu18/Uomini - 2,43 m</p>\n<p>[nbsp]</p>\n<p><strong>Classifica finale:</strong></p>\n<p><u>Open:</u> La somma dei punti di ogni tappa della squadra partecipante dà il risultato finale. Nel caso in cui 2 o più squadre abbiano lo stesso punteggio nella classifica finale, decide il maggior numero di partecipazioni al Raiffeisen Beachcup. In caso di parità viene presa in considerazione il miglior piazzamento.</p>\n<p><u>Amatoriale maschile:</u> Le tre tappe della categoria "Amatoriale" e le tre tappe "Open" valgono per la classifica finale amatoriale però nella classifica finale contano solo i quattro piazzamenti migliori (punteggio!!!). Per la paritá punti conta come descritto per l''OPEN.</p>\n<p><u>Amatoriale donne:</u> Le due tappe della categoria "Amatoriale" e le tre tappe "Open" valgono per la classifica finale amatoriale però nella classifica finale contano solo i quattro piazzamenti migliori (punteggio!!!). Per la paritá punti conta come descritto per l''OPEN.</p>\n<p><u>Giovanile</u>: Non è previsto una classifica finale.</p>\n<p><strong>Punti: I punti vanno aggiudicati a squarda.<br></strong>1° posto - 100 punti<br>2° posto - 90 punti<br>3° posto - 80 punti<br>4° posto - 70 punti<br>squadra perdente ai quarti - 60 punti<br>squadra perdente agli ottavi - 50 punti<br>terzultima classificata nel gruppo - 40 punti<br>penultima classificata nel gruppo - 30 punti<br>ultima classificata nel gruppo - 20 punti<br>I punti verranno aggiudicati a squadra.<br><strong>L''ultima tappa dà il doppio dei punti.<br></strong><strong>(1° posto - 200 punti; 2° posto - 180 punti; 3° posto - 160 punti; ecc.)</strong></p>\n<p><strong>Quota d''iscrizione:<br></strong>Nella quota d''iscrizione è inclusa l''entrata nella rispettiva piscina (se disponibile) e inoltre una maglietta del "Raiffeisen Beachcup" per giocatore per tutte le tappe.<br>I clienti "<a href="http://www.bankthefuture.it/">Bank The Future</a>" hanno diritto ad uno sconto del 20%.</p>\n<p>Per ogni ulteriore maglietta verranno richieste le spese d''acquisto di € 15,00 (materiale e stampa).</p>\n<table>\n<tbody>\n<tr>\n<td>\n<p>Categoria</p>\n</td>\n<td width="197">\n<p>prima tappa partecipata</p>\n</td>\n<td width="149">\n<p>tappe successive</p>\n</td>\n<td width="195">\n<p>clienti "Bank The Future"</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Open</p>\n</td>\n<td width="197">\n<p>50 Euro</p>\n</td>\n<td width="149">\n<p>40 Euro</p>\n</td>\n<td width="195">\n<p>20% di sconto</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Amatoriale</p>\n</td>\n<td width="197">\n<p>40 Euro</p>\n</td>\n<td width="149">\n<p>30 Euro</p>\n</td>\n<td width="195">\n<p>20% di sconto</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Giovanile</p>\n</td>\n<td width="197">\n<p>30 Euro</p>\n</td>\n<td width="149">\n<p>20 Euro</p>\n</td>\n<td width="195">\n<p>20% di sconto</p>\n</td>\n</tr>\n</tbody>\n</table>\n<p><strong>Importante:</strong> Per partecipanti che <u>non</u> sono regolarmente tesserati presso la Federazione Italiana Pallavolo FIPAV e che tramite modulo di iscrizione (liberatoria) richiedono un "tesseramento per songola manifestazione amatoriale" sono tenuti a corrispondere ulteriori 2,00€ per tappa/torneo.</p>\n<p>Se una squadra non si presenta ad una tappa senza aver tempestivamente disdetto, deve pagare ugualmente la quota d''iscrizione.</p>\n<p><strong>Vestiario:<br></strong>I giocatori sono obbligati ad usare <u>sempre</u> la maglietta ufficiale del torneo durante le partite.</p>\n<p><strong>Pallone di gioco:<br></strong>Il pallone ufficiale del "Raiffeisen Beachcup" è il Mikasa VLS300. Il pallone per le partite viene fornito dall''O.K..</p>\n<p><strong>Montepremi:<br></strong>Montepremio per ogni singola tappa:</p>\n<p>Categoria Open maschile:<br>1a squadra classificata € 160,00, 2a squadra classificata € 120,00, 3a squadra classificata € 80,00</p>\n<p>Categoria Open femminile:<br>1a squadra classificata € 120,00, 2a squadra classificata € 80,00, 3a squadra classificata € 40,00</p>\n<p>Categoria amatoriale:<br>Premi vari.</p>\n<p>Categoria giovanile:<br>Premi vari.</p>\n<p>Per la classifica finale valgono gli stessi montepremi previsti per una singola tappa.</p>\n<p><strong>Premiazione:<br></strong>La premiazione avverrà direttamente dopo ogni torneo.</p>\n<p><strong>Programma:<br></strong>Durante tutte le tappe vengono offerti dei programmi speciali. Per informazioni dettagliate vedere la pagina dell'' organizzatore locale seguendo l''apposito link sotto <a href="http://www.beachcup.it/it/tornei2015">Tornei 2015</a>.</p>\n<p><strong>Organizzazione:<br></strong>Il "Raiffeisen Beachcup" viene coordinato dalla società SSV Bruneck ASV sezione pallavolo e organizzato dai vari organizzatori locali. Per informazioni dettagliate vedere la pagina dell'' organizzatore locale seguendo l''apposito link sotto <a href="http://www.beachcup.it/it/tornei2015">Tornei 2015</a>.</p>\n<p>Il comitato organizzativo funge solo come coordinatore del tour.[nbsp]Alle singole tappe provvedono gli organizzatori locali.</p>\n<p>La partecipazione è a proprio rischio. Il corrdinatore e gli organizzatori respingono ogni responsabilità per infortuni prima, durante e dopo i tornei, neanche contro terzi. Ogni atleta è responsabile personalmente per la propria salute.</p>\n<p><strong>Modifiche:</strong></p>\n<p>In caso di necessità il comitato organizzativo può modificare il regolamento in ogni momento per garantire un buon funzionamento del torneo. Il sito internet www.beachcup.it è l''ufficale fonte di informazione della manifestazione. Per questa ragione tutte le comunicazioni saranno publicate su quel sito.</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default'),
(35, 44, 'tl_article', 256, 1460803844, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:27:"Campionato Provinciale 2015";}', '<p>Anche nel 2015 i campioni provinciali beach volley verranno individuati nel contesto del Raiffeisen Beachcup. Cosi prosegue per un altro anno la collaborazione tra il Raiffeisen Beachcup e la federazione pallavolo italiana FIPAV comitato provinciale bolzano. Il torneo si svolgerà a Brunico sui campi da beach presso la splendida piscina scoperta.[nbsp]</p>\n<p>Sabato 15 agosto 2015 si giocherà per i titoli nelle categorie uomini, donne e U16, mentre domenica 16 agosto 2015 verranno eletti i campioni nelle categorie giovanili U14 e U18 maschili e femminili.[nbsp]Possono partecipare solo coppie della provincia di Bolzano.</p>\n<p><img src="http://www.beachcup.it/images/stories/sponsoren/fipavbz.png" alt="" width="144" height="144"></p>\n<p>[nbsp]</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default'),
