(41, 53, 'tl_article', 128, 1460803803, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:11:"Note legali";}', '<p><strong>SSV Bruneck Amateursportverein Sezione Pallavolo<br></strong>Via Ferrari 26<br>I-39031 Brunico (BZ)</p>\n<p>Part. IVA 92015230219</p>\n<p>Il copyright di tutte le foto e i testi di questo sito[nbsp]sono di proprietà del SSV Bruneck ASV. L''utilizzo senza autorizzazione scritta è vietato. Si fa notare che non abbiamo alcun influsso sul contenuto e la conifgurazione di pagine collegate da questo sito. Ci dissociamo dai pareri espressi su questi siti, perchè a volte[nbsp]potrebbero anche non coincidere con le nostre opinioni.</p>\n<p>Copyright: © SSV Bruneck Amateuersportverein</p>\n<p>[nbsp]</p>\n<h2>Utilizzo di Cookies</h2>\n<p>Questo sito utilizza Cookies e tecnologie simili per consentire il corretto funzionamento del sito e per semplificare l''utilizzo del sito.</p>\n<p><strong>Cosa sono i Cookies?</strong><br>Un cookie è un piccolo file di testo che i siti salvano sul tuo computer o dispositivo mobile mentre li visiti. Grazie ai cookies il sito ricorda le tue azioni e preferenze (per es. login, lingua, dimensioni dei caratteri e altre impostazioni di visualizzazione) in modo che tu non debba reinserirle quando torni sul sito o navighi da una pagina all''altra.</p>\n<p><strong>Perchè utilizziamo Cookies?</strong><br>Utilizziamo queste informazioni per migliorare il nostro sito e per offrire ai visitatori un offerta migliore. Il nostro sito utilizza anche Cookie di parti terze.</p>\n<p><strong>Tipi di Cookies</strong><br>Questo sito utilizza i seguenti tipi di Cookies:</p>\n<ul>\n<li>Cookie tecnici e cookie analitici: questi Cookies ci danno informazioni su come viene utilizzato il nostro sito e ci permettono di migliorarlo. Questi Cookie in parte vengono forniti da parti terze (Google) e sono anonimizzate.</li>\n<li>Cookie di parti terze: esempi per questi Cookie di parti terze sono i “social plugins” di Facebook, Twitter e Google+. Questi permettoni di semplificare il processo di condivisione di contenuti su queste piattaforme. Ulteriori informazioni su questi cookie sono disponibili presso i fornitori di questi servizi.</li>\n</ul>\n<p><strong>Gestione dei Cookie</strong><br>Puoi controllare e/o verificare i cookies come vuoi – per saperne di più, vai su AllAboutCookies.org. Puoi cancellare i cookies già presenti nel computer e impostare quasi tutti i browser in modo da bloccarne l''installazione. Se scegli questa opzione, dovrai però modificare manualmente alcune preferenze ogni volta che visiti il sito ed è possibile che alcuni servizi o determinate funzioni non siano disponibili.</p>\n<p>[lt]p[nbsp][lt] p=""[gt]</p>\n<p><strong>Sito realizzato da</strong></p>\n<p><strong>project|r</strong> des Roland Trebo<br>Dantestr. 12<br>39031 Bruneck<br><a href="http://projectr.it/" target="_blank">projectr.it</a><br><br>P.Iva 02618740217</p>\n<p>[nbsp]</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default'),
