(9, 11, 1460545472, 'Reglement', 'index.php/reglement.html', 'Reglement Reglement 2015 Spielregeln: Beim Raiffeisen Beachcup wird nach den internationalen Beachvolleyball-Regeln der FIVB gespielt. Mehr Informationen dazu finden Sie auf der Homepage der FIVB oder hier download NEU 2015: Technische Richtlinien fÃ¼r die Austragung der Beachcup Jugend-Etappen Das OK des Beachcup mÃ¶chte in Zusammenarbeit mit der FIPAV Bozen, Abteilung Beachvolleyball, einige GrundsÃ¤tze schaffen um der JugendfÃ¶rderung im Beachvolleyball in SÃ¼dtirol gerecht zu werden. Die Richtlinien findet ihr hier zum DOWNLOAD Teilnahmeberechtigt: Am â€žRaiffeisen Beachcupâ€œ kÃ¶nnen alle Sportler/Innen welche beim Fachsportverband FIPAV tesseriert sind und von ihrem Verein nicht fÃ¼r die AktivitÃ¤t Beachvolleyball Ã¼ber das Online Portal der FIPAV gesperrt sind, teilnehmen. Jene die nicht Ã¼ber eine Tesserierung beim Fachsportverband FIPAV verfÃ¼gen, kÃ¶nnen bei der Einschreibung (Anmeldeformular) eine sogenannte Tagestesserierung â€žtesseramento per eventoâ€œ beantragen, welche vorbehaltlich dessen Annahme zur Teilnahme an den Turnieren berechtigt. Kategorie Open M/F: Die Teilnahme am Turnier wird nur nach Vorlage eines gÃ¼ltigen sportÃ¤rztlichen Attestes (Sportarzt!) gewÃ¤hrt, welches die uneingeschrÃ¤nkte Eignung fÃ¼r die AusÃ¼bung dieser Sportart bescheinigt! Kategorie Freizeit Herren: Es sind alle Sportler teilnahmeberechtigt, welche ein gÃ¼ltiges Ã¤rztliches Zeugnis (Hausarzt oder Sportarzt) vorweisen kÃ¶nnen und in der abgelaufenen Hallen-Saison maximal in der italienischen Serie D und noch nie in der italienischen Serie B2 oder hÃ¶her gespielt haben. Die selbe EinschrÃ¤nkung wird auf andere Ligen im Ausland angewendet. Zudem sind die Halbfinalisten der Raiffeisen Beachcup Open Etappen der letzten beiden Jahre hier nicht spielberechtigt. FÃ¼r Frauen- oder Mixed-Teams gibt es keine getrennte Wertung und keine Begrenzung bezÃ¼glich ihres Spielniveaus. Das OK des Beachcups behÃ¤lt sich das Recht