en & Buben - Jugend U14 MÃ¤dchen & Buben Es ist aus organisatorischer Sicht nicht mÃ¶glich, an einem Tag an zwei Bewerben teilzunehmen. Bei den Gruppenspielen wird ein Satz mit mindestens 15 Punkten im Rally-Point System gespielt, wobei ein Mindestvorsprung von 2 Punkten notwendig ist. Die erst- und zweitplatzierte Mannschaft qualifizieren sich fÃ¼r die nÃ¤chste Runde. Bei den darauf folgenden Spielen wird ein Satz bis 21 Punkten gespielt. Das Finale wird in 2 GewinnsÃ¤tzen entschieden (3. Satz bis 15 Punkte). Erscheint eine Mannschaft nicht innerhalb 5 Minuten zu einem Spiel (Zeitplan laut Spielplan), wird das Spiel als verloren gewertet und zwar mit 15:8 bzw. 21:11. FÃ¼r die U14 Jugendbewerbe wird in einem Feld von 7 X 14 m gespielt, alle anderen Bewerbe spielen auf einem Spielfeld mit 8 x 16 m. Die NetzhÃ¶hen gelten wie folgt: U14w - 2,05mU14m - 2,15m U16w - 2,15m U16m - 2,35m U18/Damen - 2,24 m U18/Herren - 2,43m Gesamtwertung: Open: FÃ¼r die Gesamtwertung werden die Punkte der drei Etappen zusammengezÃ¤hlt. Sollten 2 oder mehrere Mannschaften in der Gesamtwertung dieselbe Punktezahl aufweisen, wird das Team besser gewertet, das mehr Teilnahmen am Raiffeisen Beachcup hatte. Bei neuerlichem Gleichstand entscheidet die beste Platzierung in der Turnierserie. Freizeit Herren: FÃ¼r die Gesamtwertung werden die Punkte der drei Freizeitturniere und der drei Open-Turniere zusammengezÃ¤hlt, wobei nur die besten vier Etappen gewertet werden. Freizeit Damen: FÃ¼r die Gesamtwertung werden die Punkte der zwei Freizeitturniere und der drei Open-Turniere zusammengezÃ¤hlt, wobei nur die besten vier Etappen gewertet werden. In den Jugend-Kategorien gibt es keine Gesamtwertung. Punktevergabe: 1. Platz - 100 Punkte 2. Platz - 90 Punkte 3. Platz - 80 Punkte 4. Platz - 70 Punkte Verlierer Viertelfinale - 60 Punkte Verlierer Achtelfinale - 50 Punkte Gruppendrittletzter - 40 Punkte Gruppenvorletzter - 30 Punkte Gruppenletzter - 20 Punkte Die Punkte werden pro Mannschaft vergeben. Bei 