(34, 11, 1460803641, 'Reglement', 'index.php/de/reglement.html', 'Reglement Reglement 2015 Spielregeln: Beim Raiffeisen Beachcup wird nach den internationalen Beachvolleyball-Regeln der FIVB gespielt. Mehr Informationen dazu finden Sie auf der Homepage der FIVB oder hier download NEU 2015: Technische Richtlinien fÃ¼r die Austragung der Beachcup Jugend-Etappen Das OK des Beachcup mÃ¶chte in Zusammenarbeit mit der FIPAV Bozen, Abteilung Beachvolleyball, einige GrundsÃ¤tze schaffen um der JugendfÃ¶rderung im Beachvolleyball in SÃ¼dtirol gerecht zu werden. Die Richtlinien findet ihr hier zum DOWNLOAD Teilnahmeberechtigt: Am â€žRaiffeisen Beachcupâ€œ kÃ¶nnen alle Sportler/Innen welche beim Fachsportverband FIPAV tesseriert sind und von ihrem Verein nicht fÃ¼r die AktivitÃ¤t Beachvolleyball Ã¼ber das Online Portal der FIPAV gesperrt sind, teilnehmen. Jene die nicht Ã¼ber eine Tesserierung beim Fachsportverband FIPAV verfÃ¼gen, kÃ¶nnen bei der Einschreibung (Anmeldeformular) eine sogenannte Tagestesserierung â€žtesseramento per eventoâ€œ beantragen, welche vorbehaltlich dessen Annahme zur Teilnahme an den Turnieren berechtigt. Kategorie Open M/F: Die Teilnahme am Turnier wird nur nach Vorlage eines gÃ¼ltigen sportÃ¤rztlichen Attestes (Sportarzt!) gewÃ¤hrt, welches die uneingeschrÃ¤nkte Eignung fÃ¼r die AusÃ¼bung dieser Sportart bescheinigt! Kategorie Freizeit Herren: Es sind alle Sportler teilnahmeberechtigt, welche ein gÃ¼ltiges Ã¤rztliches Zeugnis (Hausarzt oder Sportarzt) vorweisen kÃ¶nnen und in der abgelaufenen Hallen-Saison maximal in der italienischen Serie D und noch nie in der italienischen Serie B2 oder hÃ¶her gespielt haben. Die selbe EinschrÃ¤nkung wird auf andere Ligen im Ausland angewendet. Zudem sind die Halbfinalisten der Raiffeisen Beachcup Open Etappen der letzten beiden Jahre hier nicht spielberechtigt. FÃ¼r Frauen- oder Mixed-Teams gibt es keine getrennte Wertung und keine Begrenzung bezÃ¼glich ihres Spielniveaus. Das OK des Beachcups behÃ¤lt sich das Recht vor einzelne Spieler oder Mannschaften aufgrund ihrer SpielstÃ¤rke die Teilnahme in dieser Kategorie zu erlauben oder zu verwehren. Kategorie Freizeit Damen: Es sind alle Sportlerinnen teilnahmeberechtigt, welche ein gÃ¼ltiges Ã¤rztliches Zeugnis (Hausarzt oder Sportarzt) vorweisen kÃ¶nnen und in der abgelaufenen Hallen-Saison maximal in der italienischen 1. Division und noch nie in der italienischen Serie C oder hÃ¶her gespielt haben. Die selbe EinschrÃ¤nkung wird auf andere Ligen im Ausland angewendet. Zudem sind die Halbfinalisten der Raiffeisen Beachcup Open Etappen der letzten beiden Jahre hier nicht spielberechtigt. Das OK des Beachcups behÃ¤lt sich das Recht vor, einzelne Spieler oder Mannschaften aufgrund ihrer SpielstÃ¤rke die Teilnahme in dieser Kategorie zu erlauben oder zu verwehren. Kategorie Jugend: Es sind alle SportlerInnen teilnahmeberechtigt, welche ein gÃ¼ltiges Ã¤rztliches Zeugnis (Hausarzt oder Sportarzt) vorweisen kÃ¶nnen. Es gelten folgende AltersbeschrÃ¤nkungen: U18 M/F: geboren nach dem 01.01.1998 U16 M/F: geboren nach dem 01.01.2000 U14 M/F: geboren nach dem 01.01.2002 Einschreibungen: Die Anmeldungen kÃ¶nnen ausschlieÃŸlich online auf www.beachcup.it bis innerhalb Mittwoch 18:00 Uhr vor der jeweiligen Etappe gemacht werden, solange noch freie PlÃ¤tze verfÃ¼gbar sind. Die Einschreibung ist nur gÃ¼ltig, wenn die EigenerklÃ¤rung bzw. DatenschutzerklÃ¤rung sowie das Ã¤rztliche Attest (Details dazu unter der jeweiligen Kategorie) ebenfalls innerhalb Mittwoch 18:00 Uhr vor der jeweiligen Etappe entweder an die Faxnummer 0474 05 06 08 oder an info@beachcup.it gesendet wird. Weitere Infos unter Tel. +39 393 7064116 oder per mail: info@beachcup.it Turniermodus: Die Veranstaltung gliedert sich in mehrere Etappen und unterschiedliche Kategorien (Details zu jeder Etappe unter Turniere 2015). Die Turniere finden bei jeder Witterung statt. Spielkategorien: - Open Damen & Herren - Freizeit Herren & Damen - Jugend U18 MÃ¤dchen & Buben - Jugend U16 MÃ¤dchen & Buben - Jugend U14 MÃ¤dchen & Buben Es ist aus organisatorischer Sicht nicht mÃ¶glich, an einem Tag an zwei Bewerben teilzunehmen. Bei den Gruppenspielen wird ein Satz mit mindestens 15 Punkten im Rally-Point System gespielt, wobei ein Mindestvorsprung von 2 Punkten notwendig ist. Die erst- und zweitplatzierte Mannschaft qualifizieren sich fÃ¼r die nÃ¤chste Runde. Bei den darauf folgenden Spielen wird ein Satz bis 21 Punkten gespielt. Das Finale wird in 2 GewinnsÃ¤tzen entschieden (3. Satz bis 15 Punkte). Erscheint eine Mannschaft nicht innerhalb 5 Minuten zu einem Spiel (Zeitplan laut Spielplan), wird das Spiel als verloren gewertet und zwar mit 15:8 bzw. 21:11. FÃ¼r die U14 Jugendbewerbe wird in einem Feld von 7 X 14 m gespielt, alle anderen Bewerbe spielen auf einem Spielfeld mit 8 x 16 m. Die NetzhÃ¶hen gelten wie folgt: U14w - 2,05mU14m - 2,15m U16w - 2,15m U16m - 2,35m U18/Damen - 2,24 m U18/Herren - 2,43m Gesamtwertung: Open: FÃ¼r die Gesamtwertung werden die Punkte der drei Etappen zusammengezÃ¤hlt. Sollten 2 oder mehrere Mannschaften in der Gesamtwertung dieselbe Punktezahl aufweisen, wird das Team besser gewertet, das mehr Teilnahmen am Raiffeisen Beachcup hatte. Bei neuerlichem Gleichstand entscheidet die beste Platzierung in der Turnierserie. Freizeit Herren: FÃ¼r die Gesamtwertung werden die Punkte der drei Freizeitturniere und der drei Open-Turniere zusammengezÃ¤hlt, wobei nur die besten vier Etappen gewertet werden. Freizeit Damen: FÃ¼r die Gesamtwertung werden die Punkte der zwei Freizeitturniere und der drei Open-Turniere zusammengezÃ¤hlt, wobei nur die besten vier Etappen gewertet werden. In den Jugend-Kategorien gibt es keine Gesamtwertung. Punktevergabe: 1. Platz - 100 Punkte 2. Platz - 90 Punkte 3. Platz - 80 Punkte 4. Platz - 70 Punkte Verlierer Viertelfinale - 60 Punkte Verlierer Achtelfinale - 50 Punkte Gruppendrittletzter - 40 Punkte Gruppenvorletzter - 30 Punkte Gruppenletzter - 20 Punkte Die Punkte werden pro Mannschaft vergeben. 