(59, 11, 1460816046, 'Reglement', 'de/reglement.html', 'Reglement Reglement 2015 Spielregeln: Beim Raiffeisen Beachcup wird nach den internationalen Beachvolleyball-Regeln der FIVB gespielt. Mehr Informationen dazu finden Sie auf der Homepage der FIVB oder hier download NEU 2015: Technische Richtlinien für die Austragung der Beachcup Jugend-Etappen Das OK des Beachcup möchte in Zusammenarbeit mit der FIPAV Bozen, Abteilung Beachvolleyball, einige Grundsätze schaffen um der Jugendförderung im Beachvolleyball in Südtirol gerecht zu werden. Die Richtlinien findet ihr hier zum DOWNLOAD Teilnahmeberechtigt: Am „Raiffeisen Beachcup“ können alle Sportler/Innen welche beim Fachsportverband FIPAV tesseriert sind und von ihrem Verein nicht für die Aktivität Beachvolleyball über das Online Portal der FIPAV gesperrt sind, teilnehmen. Jene die nicht über eine Tesserierung beim Fachsportverband FIPAV verfügen, können bei der Einschreibung (Anmeldeformular) eine sogenannte Tagestesserierung „tesseramento per evento“ beantragen, welche vorbehaltlich dessen Annahme zur Teilnahme an den Turnieren berechtigt. Kategorie Open M/F: Die Teilnahme am Turnier wird nur nach Vorlage eines gültigen sportärztlichen Attestes (Sportarzt!) gewährt, welches die uneingeschränkte Eignung für die Ausübung dieser Sportart bescheinigt! Kategorie Freizeit Herren: Es sind alle Sportler teilnahmeberechtigt, welche ein gültiges ärztliches Zeugnis (Hausarzt oder Sportarzt) vorweisen können und in der abgelaufenen Hallen-Saison maximal in der italienischen Serie D und noch nie in der italienischen Serie B2 oder höher gespielt haben. Die selbe Einschränkung wird auf andere Ligen im Ausland angewendet. Zudem sind die Halbfinalisten der Raiffeisen Beachcup Open Etappen der letzten beiden Jahre hier nicht spielberechtigt. Für Frauen- oder Mixed-Teams gibt es keine getrennte Wertung und keine Begrenzung bezüglich ihres Spielniveaus. Das OK des Beachcups behält sich das Recht vor einzelne Spieler oder Mannschaften aufgrund ihrer Spielstärke die Teilnahme in dieser Kategorie zu erlauben oder zu verwehren. Kategorie Freizeit Damen: Es sind alle Sportlerinnen teilnahmeberechtigt, welche ein gültiges ärztliches Zeugnis (Hausarzt oder Sportarzt) vorweisen können und in der abgelaufenen Hallen-Saison maximal in der italienischen 1. Division und noch nie in der italienischen Serie C oder höher gespielt haben. Die selbe Einschränkung wird auf andere Ligen im Ausland angewendet. Zudem sind die Halbfinalisten der Raiffeisen Beachcup Open Etappen der letzten beiden Jahre hier nicht spielberechtigt. Das OK des Beachcups behält sich das Recht vor, einzelne Spieler oder Mannschaften aufgrund ihrer Spielstärke die Teilnahme in dieser Kategorie zu erlauben oder zu verwehren. Kategorie Jugend: Es sind alle SportlerInnen teilnahmeberechtigt, welche ein gültiges ärztliches Zeugnis (Hausarzt oder Sportarzt) vorweisen können. Es gelten folgende Altersbeschränkungen: U18 M/F: geboren nach dem 01.01.1998 U16 M/F: geboren nach dem 01.01.2000 U14 M/F: geboren nach dem 01.01.2002 Einschreibungen: Die Anmeldungen können ausschließlich online auf www.beachcup.it bis innerhalb Mittwoch 18:00 Uhr vor der jeweiligen Etappe gemacht werden, solange noch freie Plätze verfügbar sind. Die Einschreibung ist nur gültig, wenn die Eigenerklärung bzw. Datenschutzerklärung sowie das ärztliche Attest (Details dazu unter der jeweiligen Kategorie) ebenfalls innerhalb Mittwoch 18:00 Uhr vor der jeweiligen Etappe entweder an die Faxnummer 0474 05 06 08 oder an info@beachcup.it gesendet wird. Weitere Infos unter Tel. +39 393 7064116 oder per mail: info@beachcup.it Turniermodus: Die Veranstaltung gliedert sich in mehrere Etappen und unterschiedliche Kategorien (Details zu jeder Etappe unter Turniere 2015). Die Turniere finden bei jeder Witterung statt. Spielkategorien: - Open Damen & Herren - Freizeit Herren & Damen - Jugend U18 Mädchen & Buben - Jugend U16 Mädchen & Buben - Jugend U14 Mädchen & Buben Es ist aus organisatorischer Sicht nicht möglich, an einem Tag an zwei Bewerben teilzunehmen. Bei den Gruppenspielen wird ein Satz mit mindestens 15 Punkten im Rally-Point System gespielt, wobei ein Mindestvorsprung von 2 Punkten notwendig ist. Die erst- und zweitplatzierte Mannschaft qualifizieren sich für die nächste Runde. Bei den darauf folgenden Spielen wird ein Satz bis 21 Punkten gespielt. Das Finale wird in 2 Gewinnsätzen entschieden (3. Satz bis 15 Punkte). Erscheint eine Mannschaft nicht innerhalb 5 Minuten zu einem Spiel (Zeitplan laut Spielplan), wird das Spiel als verloren gewertet und zwar mit 15:8 bzw. 21:11. Für die U14 Jugendbewerbe wird in einem Feld von 7 X 14 m gespielt, alle anderen Bewerbe spielen auf einem Spielfeld mit 8 x 16 m. Die Netzhöhen gelten wie folgt: U14w - 2,05mU14m - 2,15m U16w - 2,15m U16m - 2,35m U18/Damen - 2,24 m U18/Herren - 2,43m Gesamtwertung: Open: Für die Gesamtwertung werden die Punkte der drei Etappen zusammengezählt. Sollten 2 oder mehrere Mannschaften in der Gesamtwertung dieselbe Punktezahl aufweisen, wird das Team besser gewertet, das mehr Teilnahmen am Raiffeisen Beachcup hatte. Bei neuerlichem Gleichstand entscheidet die beste Platzierung in der Turnierserie. Freizeit Herren: Für die Gesamtwertung werden die Punkte der drei Freizeitturniere und der drei Open-Turniere zusammengezählt, wobei nur die besten vier Etappen gewertet werden. Freizeit Damen: Für die Gesamtwertung werden die Punkte der zwei Freizeitturniere und der drei Open-Turniere zusammengezählt, wobei nur die besten vier Etappen gewertet werden. In den Jugend-Kategorien gibt es keine Gesamtwertung. Punktevergabe: 1. Platz - 100 Punkte 2. Platz - 90 Punkte 3. Platz - 80 Punkte 4. Platz - 70 Punkte Verlierer Viertelfinale - 60 Punkte Verlierer Achtelfinale - 50 Punkte Gruppendrittletzter - 40 Punkte Gruppenvorletzter - 30 Punkte Gruppenletzter - 20 Punkte Die Punkte werden pro Mannschaft vergeben. Bei der letzten Etappe wird die doppelte Punktezahl vergeben. (1. Platz - 200 Punkte.; 2. Platz - 180 Punkte; 3. Platz - 160 Punkte; usw.) Nenngebühr*: Die Nenngebühr beinhaltet den Eintritt in die jeweiligen Schwimmbäder (falls vorhanden), sowie einmal für die gesamte Tour ein Spielleibchen des "Raiffeisen Beachcup" pro Spieler. "Bank The Future" Kunden erhalten eine Ermäßigung von 20%. Jedes weitere Spielleibchen wird vom Veranstalter gegen den Unkostenbeitrag von € 15,00 weitergegeben (Materialkosten und Aufdruck). Kategorie Nenngebühr Erstteilnahme jede weitere Etappe Bank The Future Kunden Open 50 Euro 40 Euro 20% Ermäßigung Freizeit 40 Euro 30 Euro 20% Ermäßigung Jugend 30 Euro 20 Euro 20% Ermäßigung *WICHTIG: für Spieler welche noch nicht beim Fachsportverband „FIPAV“ gemeldet sind und über das Einschreibeformular (Datenschutzerklärung) eine Tagestesserierung „tesseramento per evento“ beantragen fallen zusätzlich 2,00 € pro Etappe an. Erscheint eine Mannschaft nicht zu einer Etappe ohne sich vorher rechtzeitig abzumelden, muss die Einschreibegebühr trotzdem entrichtet werden. Spielbekleidung: Die Spieler müssen immer mit den offiziellen Turnierdressen spielen. Spielball: Der offizielle Spielball des "Raiffeisen Beachcup" ist der Mikasa VLS300. Dieser wird für die Spiele vom OK zur Verfügung gestellt. Preisgeld: Pro Turnier wird um folgendes Preisgeld gespielt: Kategorie Open Herren: Erstplatzierte Mannschaft € 160,00, Zweitplatzierte Mannschaft € 120,00, Drittplatzierte Mannschaft € 80,00 Kategorie Open Damen: Erstplatzierte Mannschaft € 120,00, Zweitplatzierte Mannschaft € 80,00, Drittplatzierte Mannschaft € 40,00 Kategorien Freizeit Herren & Damen: Sachpreise für die ersten 4 Mannschaften. Kategorie Jugend: Sachpreise. Für die Gesamtwertung werden dieselben Preisgelder ausbezahlt wie bei einer einzelnen Etappe. Preisverteilung: Die Preisverteilung findet stets nach Beendigung des Turniers statt. Die ersten vier Mannschaften werden prämiert. Rahmenprogramm: Bei den einzelnen Etappen werden verschiedene Rahmenprogramme geboten. Details dazu findet man unter dem Link des jeweiligen Veranstaltungsortes auf Turniere 2015. Organisation: Der RAIFFEISEN BEACHCUP wird vom SSV Bruneck ASV - Sektion Volleyball koordiniert und von den jeweiligen lokalen Veranstaltern organisiert. Details dazu findet man unter dem Link des jeweiligen Veranstaltungsortes auf Turniere 2015. Das Organisationskomitee fungiert lediglich als Koordinator der Tour. Die einzelnen Turniere werden selbstständig von den lokalen Organisatoren durchgeführt. Die Teilnahme erfolgt auf eigenes Risiko. Der Korrdinator und die lokalen Veranstalter übernehmen keinerlei Haftung für Unfälle vor, während und nach den Turnieren, auch nicht Dritten gegenüber. Jeder einzelne Spieler trägt die volle persönliche Verantwortung für seinen Gesundheitszustand. Änderungen: Der Veranstalter behält sich die Möglichkeit vor, Programmänderungen durchzuführen. Die Internetseite www.beachcup.it ist die offizielle Informationsquelle der Veranstaltung. Aus diesem Grund sind alle offiziellen Mitteilungen auf dieser Seite zu finden. Beachcup News Letzer Test Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet. Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet. Test Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet. Lorem ipsum dolor sit amet, conse